import React, { Fragment, Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    const name = 'Sahana';
    const foo = () => 'Bar';
    return (
      // JSX
      //Needs to have one parent element div
      <Fragment>
        <h1>Hello from {this.foo()}</h1>
        <h2>Good bye</h2>
      </Fragment>
    );
  }
}

export default App;
